import React from 'react'
import { Link } from 'react-router-dom'

export default function Navigation() {

  return (
    <div className="navigation">
      <div className='nav-left-space'>Jon Langkammer</div>
      <div className='nav-link'><Link to="/about" className='nav-links'>About</Link></div>
      <div className='nav-link'><Link to="/skills" className='nav-links'>Skills</Link></div>
      <div className='nav-link'><Link to="/projects" className='nav-links'>Projects</Link></div>
      <div className='nav-right-space'></div>
    </div>
  )
}
